<template>
    <div>
        <div class="vx-col w-full mb-base" v-if="can('view-prescription')">
            <vx-card ref="view" title='General Information' collapseAction refreshContentAction @refresh="getPrescription">
                <vs-row v-if="report">
                    <vs-col vs-lg="6" vs-sm="12" vs-xs="12" class="mb-5 pl-5">
                        <b>Creator Name: </b> <a href="#" @click="$router.push({name: 'view-employee', params: {id: report.creator.id}})">{{report.creator.first_name}} {{report.creator.last_name}}</a>
                    </vs-col>
                    <vs-col vs-lg="6" vs-sm="12" vs-xs="12" class="mb-5 pl-5">
                        <b>Patient Name: </b> <a href="#" @click="$router.push({name: 'profile-patient', params: {id: report.patient.id}})">{{report.patient.first_name}} {{report.patient.last_name}}</a>
                    </vs-col>
                    <vs-col vs-lg="6" vs-sm="12" vs-xs="12" class="mb-5 pl-5">
                        <b>Created At: </b> {{ report.created_at | date(true) }} {{ report.created_at | time }}
                    </vs-col>
                    <vs-col vs-lg="6" vs-sm="12" vs-xs="12" class="mb-5 pl-5">
                        <b>Last Modification: </b> {{ report.updated_at | date(true) }} {{ report.updated_at | time }}
                    </vs-col>
                </vs-row>
                <vs-row v-if="report">
                    <vs-col vs-type="flex" vs-align="center" vs-justify="center">
                        <vs-button :to="`/dashboard/report/${$route.params.id}/edit`" size="small" color="warning" icon-pack="feather" icon="icon-edit">Edit Report</vs-button>
                    </vs-col>
                </vs-row>
            </vx-card>
        </div>

        <div class="vx-col w-full mb-base" v-if="can('view-prescription')">
            <vx-card ref="view" title='Report' collapseAction refreshContentAction @refresh="getPrescription">
                <vs-row v-if="report">
                    <vs-col vs-lg="12" vs-sm="12" vs-xs="12" class="mb-5">
                        <div ref="pdfcontent" :class="`quill-editor rich-text-container ${width_675}`" v-html="report.description"></div>
                    </vs-col>
                </vs-row>
            </vx-card>
        </div>
    </div>
</template>

<script>
    import jsPDF from 'jspdf';
    import 'jspdf-autotable';
    import html2canvas from 'html2canvas';
    export default {
        name: "view",
        mounted() {
            this.getPrescription();
        },
        data: () => {
            return {
                report: null,
                width_675: ''
            }
        },
        methods: {
            pdfHeader(doc) {
                let currFont = doc.getFontSize();
                let pageWidth = doc.internal.pageSize.width || doc.internal.pageSize.getWidth();
                doc.setFontSize(20);

                doc.text('Report', pageWidth / 2, 25, {
                    'align': 'center',
                    'maxWidth': '110'
                });
                doc.setFontSize(currFont);
                doc.addImage('data:image/jpeg;base64,',
                    'JPEG', 15, 7, 30, 30);

                return doc;
            },

            pdfFooter(doc) {
                let currFont = doc.getFontSize();
                doc.setFontSize(12);
                doc.text('Powered By', 90, 290, 'center');
                let logo = "data:image/jpeg;base64,";
                doc.addImage(logo, 'JPEG', 102, 285, 13, 8);
                doc.text('British Dental Clinic', 135, 290, 'center');
                doc.setFontSize(currFont);
                return doc;
            },

            exportPdfEn()
            {
                var doc = new jsPDF();
                doc=this.pdfHeader(doc);
                doc.fromHTML(this.$refs.pdfcontent,15, 50, {
                    width: 500
                });
                doc=this.pdfFooter(doc);
                doc.save('Prescription.pdf');
                // var canvasElement = document.createElement('canvas');
                // html2canvas(this.$refs.pdfcontent, { canvas: canvasElement
                // }).then(canvas => {
                //     const img = canvas.toDataURL("image/jpeg", 0.8);
                //     doc.addImage(img,'JPEG',15,50);
                //     doc=this.pdfFooter(doc);
                //     doc.save('Prescription.pdf');
                // });
            },

            exportPdfAr()
            {
                let doc = new jsPDF();
                doc=this.pdfHeader(doc);
                this.width_675='w-675';
                // var canvasElement = document.createElement('canvas');
                // doc.setLanguage('ar-EG');
                // var font = '';

                var font = '';

                doc.addFileToVFS("Cairo-Regular-normal.ttf", font);
                doc.addFont('Cairo-Regular-normal.ttf', 'Cairo-Regular', 'normal');

                doc.setFont('Cairo-Regular');
                doc.setFontSize(11);
                let newText = this.report.description;
                for(let i =120; i< this.report.description.length; i+=100){
                    if(newText[i]!== " "){
                        let z=i;
                        for(let y=i; newText[y]!==' '; y++){
                            z++;
                        }
                        newText = newText.slice(0, z) + "\n" + newText.slice(z-1);
                    } else {
                        newText = newText.slice(0, i) + "\n" + newText.slice(i-1);
                    }
                }
                doc.text(newText
                    , 200, 55,
                    {
                    'align': 'right'
                    }
                );
                doc=this.pdfFooter(doc);
                doc.save('Prescription.pdf');

                // doc.fromHTML(this.$refs.pdfcontent,15, 50, {
                //     width: 500
                // });
                //
                // doc=this.pdfFooter(doc);
                // doc.save('Prescription.pdf');
                // this.width_675='';
                // html2canvas(this.$refs.pdfcontent, {
                //     useCORS: true
                // }).then(canvas => {
                //     // document.body.appendChild(canvas);
                //     const img = canvas.toDataURL('image/png');
                //     doc.addImage(img,'png',15,50);
                //     doc=this.pdfFooter(doc);
                //     doc.save('Prescription.pdf');
                //     this.width_675='';
                //     this.$refs.pdfcontent.appendChild(canvas);
                // });


                // html2canvas(this.$refs.pdfcontent, {
                //     canvas: canvasElement,
                //     letterRendering:true,
                //     useCORS: true
                // }).then(canvas => {
                //     const img = canvas.toDataURL('image/png');
                //     console.log(img);
                //     // document.body.appendChild(img);
                //     doc.addImage(img,'png',15,50);
                //     doc=this.pdfFooter(doc);
                //     doc.save('Prescription.pdf');
                //     this.width_675='';
                // });
            },

            getPrescription()
            {
                this.$vs.loading({container: this.$refs.view.$refs.content, scale: 0.5});
                this.$store.dispatch('prescription/view', this.$route.params.id)
                    .then(response => {
                        this.$vs.loading.close(this.$refs.view.$refs.content);
                        this.report = response.data.data.data;
                    })
                    .catch(error => {
                        console.log(error);
                        this.$vs.loading.close(this.$refs.view.$refs.content);
                        this.$vs.notify({
                            title: 'Error',
                            text: error.response.data.error,
                            iconPack: 'feather',
                            icon: 'icon-alert-circle',
                            color: 'danger'
                        });
                    });
            }
        }
    }
</script>

